import React from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, NavItem, Nav } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';

const Header = () => {
    return (
        <NavLink to="/">Home</NavLink>
    )
}

export default Header;
